import React from "react";

const Overview = ({ quoteSummary }) => {
  const displayOverview = (
    <>
      <div className="row">
        <div className="col-6">
          <div className="text-primary">
            <h4>
              {quoteSummary
                ? quoteSummary?.quoteType.symbol.replace(".BK", "")
                : "-"}
            </h4>
          </div>
          <div>{quoteSummary ? quoteSummary?.quoteType.longName : "-"}</div>
        </div>
        <div className="col-2">
          <div className="text-primary">
            <h4>
              {quoteSummary
                ? quoteSummary?.financialData.currentPrice.fmt
                : "-"}{" "}
              บาท
            </h4>
          </div>
          <div>ราคาตลาด</div>
        </div>
        <div className="col-2">
          <div className="text-primary">
            <h4>
              {quoteSummary ? quoteSummary?.summaryDetail.marketCap.fmt : "-"}
            </h4>
          </div>
          <div>มูลค่าตลาด</div>
        </div>
        <div className="col-2">
          <div className="text-primary">
            <h4>
              {quoteSummary
                ? quoteSummary.defaultKeyStatistics["52WeekChange"].fmt
                : "-"}
            </h4>
          </div>
          <div>ผลตอบแทน 1 ปี</div>
        </div>
      </div>
    </>
  );

  return (
    <div>
      {quoteSummary ? (
        <div className="my-4 px-4 py-2">displayOverview</div>
      ) : (
        ""
      )}
    </div>
  );
};

export default Overview;
